import React, { Component } from "react";
import "./Treeview.css"

class TreeView extends Component {
  render() {
    return (
      <div name="TreeView">
      <div className="fav">Favourites
      <span> Music </span>
      <span> Movies </span>
       <span> Movies </span>

       </div>
       <div className="fav">Icloud
      <span> icloud Drive</span>
      <span> Documents </span>
       <span> Desktop </span>

       </div>
        </div>
    );
  }
}

export default TreeView;
